import React, { Component } from 'react'
import axios from 'axios'
import NestedGrid from "../components/NestedGrid"
import { makeStyles } from '@material-ui/core/styles';

const style=makeStyles({
    root: {
        flexGrow: 1,
      },
    card: {
        padding: '8px',
        textAlign: 'center',
        maxWidth: 345,
    },
    media: {
        height: 160,
    },
  })


export default class Articulos extends Component {
    estilo=style();
    constructor(props){
        super(props);
        this.state={
            articulos:[]
        };
        
        
    }
    
    componentWillMount()
    {
        axios.get('https://api.myjson.com/bins/s80td')
        .then(res=>this.setState({articulos:res.data}))
    }
    /*
      return this.state.articulos.map((articulo)=>(
            <React.Fragment>
                <Articulo key={articulo.id} articulo={articulo} ver={this.props.ver} estilo={this.useStyles}/>
            </React.Fragment>
        ))
    */
    render() {
        
        
          return(
            <React.Fragment>
            <NestedGrid articulos={this.state.articulos} estilo={estilo}/>
            </React.Fragment>
            )
        
    }
}
